import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import rick1 from '../img/rick1.jpg';
import rick2 from '../img/rick2.jpg';
import rick3 from '../img/rick3.png';
import '../App.css';


function Home() {
  return (
    <Container>
      <Carousel>
        <Carousel.Item interval={1000}>
          <img
            className="d-block"
            src={rick1}
            alt="First slide"
            id='imgCarousel'
          />
        </Carousel.Item>
        <Carousel.Item interval={1000}>
          <img
            className="d-block"
            src={rick2}
            alt="Second slide"
            id='imgCarousel'
          />
        </Carousel.Item>
        <Carousel.Item Interval={1000}>
          <img
            className="d-block"
            src={rick3}
            alt="Third slide"
            id='imgCarousel'
          />
        </Carousel.Item>
      </Carousel>
    <br/><hr id='Line'/><br/>
    <a href='/' > <img
            src={rick3}
            alt="Third slide"
            id='imgButton'
          /></a>

    </Container>
  );
}


export default Home;
